interface Link {
  linkName: string;
  link: string;
}

interface Resource {
  pageId: string;
  resourceId: string;
  title: string;
  description: string;
  type: string;
  source: string;
  imageUrl: string;
  links: Link[];
}

interface Note {
  pageId: string;
  notesId: string;
  title: string;
  description: string;
  links: Link[];
  imageUrl: string;
}

interface PageData {
  label: string;
  description: string;
  links: Link[];
}

interface Page {
  id: string;
  position: {
    x: number;
    y: number;
  };
  data: PageData;
  resource: Resource[];
  notes: Note[];
}

interface Collection {
  name: string;
  icon: string;
}

interface AiResponse {
  collection: Collection;
  pages: Page[];
}

interface GlobalState {
  aiResponse: AiResponse;

}

