async function Fetch_Groq_Response(pageContent:any) 
{
  const response = await fetch("/api/groq", {
    method: "POST",
    headers: 
    {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({ content: pageContent }),
  });

  return response;
}






const ParseJsonData = async(data:any)=>
{
  try
  {
      const ParsedJson = JSON.parse(data);
      return ParsedJson;
  }
  catch(error:any)
  {
    console.log(`Parse Error :`,error)
    return "";
  }
}


  const handleClose = () => 
  {
      setVisible(false);
  };



  
  async function Generate_Collection_Naame(getContent:any) 
  {
   try
   {

      
    const CollectionQuery = 
    `
         Create a title for my query "${getContent}" limiting to 10 characters.

         Provide me a suitable icon for the same.

         Provide me in JSON format as below:
         {
              "collection": "name or title for the input query",
              "icon": "suitable emoji icon "
         }
    `


     const getPagesResponse = await Fetch_Groq_Response(CollectionQuery);
    
     const data = await getPagesResponse.json();

     const jsonParsed = await ParseJsonData(data?.content);

     return jsonParsed;
  }
  catch(error:any)
  {
     console.log("Collection name generation error :",error)
  }
}




  async function Generate_Page_Title(getContent:any) 
  {
   try
   {

     const PagesQuery = `  
     Input: 
                 
        Give me 5 - 10 page titles on "${getContent}" 
  
        Dot points only
  
        Provide me the output in json format as below
        { 
             "response": [ [{ "title": "page title", "icon": "suitable emoji     icon"}, ..] 
       }
    `

     const getPagesResponse = await Fetch_Groq_Response(PagesQuery);
    
     const data = await getPagesResponse.json();

     const jsonParsed = await ParseJsonData(data?.content);

     return jsonParsed;
  }
  catch(error:any)
  {
     console.log("Page generation error :",error)
  }
}


  async function Generate_Pages_Description(PageTitle:any, getContent:any) 
  {

    try
    {

      const DescriptionQuery = 
      `
        For "${PageTitle}" under the topic "${getContent}" give me 5 - 10 paragraphs.

        Then give me 5 - 10 resources and URLs in dot points.

        Provide me the output in json format as below
        {
          "response": "simple html formatted output of 5 - 10 paragraphs",
           "resources" : [
                 {
           
            "source": "source information",
                               "title":"resource title",
                               "type": "type information",
                               "links": [{"link":"","linkName":""}]
                               "description": "simple html formatted description of  title or URL in 3 - 5 paragraphs"
                 }
             ] 
        }
      `

        const getPagesResponse = await Fetch_Groq_Response(DescriptionQuery);
    
        const data = await getPagesResponse.json();

        const jsonParsed = await ParseJsonData(data?.content);

        if(jsonParsed)
        {
          return jsonParsed;
        }
  
      }
      catch(error:any)
      {
         console.log("Page description generation error:",error)
      }
  }




  async function Generate_Resource_Data(PageTitle:any, UserInput:any)
  {

    try
    {

        const ResourceQuery = 
        `
         For the title "${PageTitle}" with the URL 
         "${UserInput}"

         Provide me the Source, Type, Links and Description

         Provide me in JSON format as below:
         {  
           "source": "source information",
           "title":"resource title",
           "type": "type information",
           "links": [{"link":"","linkName":""}]
           "description": "simple html formatted description of title or URL in 3 - 5  paragraphs"
         }
        `

        const getResourceResponse = await Fetch_Groq_Response(ResourceQuery);
  
        const data = await getResourceResponse.json();

        const jsonParsed = await ParseJsonData(data?.content);

        return jsonParsed;
      
      }
      catch(error:any)
      {
          console.log("Page resource generation error:",error)
      }
  }



  
